(function(){
var isPlaying = false;      // Are we currently playing?
var startTime;              // The start time of the entire sequence.
var current16thNote;        // What note is currently last scheduled?
var tempo = 120.0;          // tempo (in beats per minute)
var lookahead = 25.0;       // How frequently to call scheduling function 
                            //(in milliseconds)
var scheduleAheadTime = 0.1;    // How far ahead to schedule audio (sec)
                            // This is calculated from lookahead, and overlaps 
                            // with next interval (in case the timer is late)
var nextNoteTime = 0.0;     // when the next note is due.
var noteResolution = 0;     // 0 == 16th, 1 == 8th, 2 == quarter note
var noteLength = 0.05;      // length of "beep" (in seconds)
var timerID = 0;            // setInterval identifier.

var canvas,                 // the canvas element
    canvasContext;          // canvasContext is the canvas' context 2D
var last16thNoteDrawn = -1; // the last "box" we drew on the screen
var notesInQueue = [];      // the notes that have been put into the web audio,
                            // and may or may not have played yet. {note, time}
var audio1,audio2,audio3;
function nextNote() {
    // Advance current note and time by a 16th note...
    var secondsPerBeat = 60.0 / tempo;    // Notice this picks up the CURRENT 
                                          // tempo value to calculate beat length.
    nextNoteTime += 0.25 * secondsPerBeat;    // Add beat length to last beat time

    current16thNote++;    // Advance the beat number, wrap to zero
    if (current16thNote == 16) {
        current16thNote = 0;
    }
}

function scheduleNote( beatNumber, time ) {
    // push the note on the queue, even if we're not playing.
    notesInQueue.push( { note: beatNumber, time: time } );

    if ( (noteResolution==1) && (beatNumber%2))
        return; // we're not playing non-8th 16th notes
    if ( (noteResolution==2) && (beatNumber%4))
        return; // we're not playing non-quarter 8th notes

    // create an oscillator
    var audio = audio1;
    // audio.connect( context.destination );
    if (beatNumber % 16 === 0)    // beat 0 == low pitch
        audio =audio1;
    else if (beatNumber % 4)    // quarter notes = medium pitch
        audio=audio2;
    else                        // other 16th notes = high pitch
        audio=audio3;

    audio.play( time,time + noteLength );
}

function scheduler() {
    // while there are notes that will need to play before the next interval, 
    // schedule them and advance the pointer.
    while (nextNoteTime < context.currentTime + scheduleAheadTime ) {
        scheduleNote( current16thNote, nextNoteTime );
        nextNote();
    }
    timerID = window.setTimeout( scheduler, lookahead );
}
function play() {
    isPlaying = !isPlaying;

    if (isPlaying) { // start playing
        current16thNote = 0;
        nextNoteTime = context.currentTime;
        scheduler();    // kick off scheduling
        return "stop";
    } else {
        window.clearTimeout( timerID );
        return "play";
    }
}
BKGM.Metronome=function(beep1,beep2,beep3){
	audio1=new BKGM.Sound('');
	audio2=new BKGM.Sound('');
	audio3=new BKGM.Sound('');
	// this.timeoutId=0;	

}
BKGM.Metronome.prototype={	
	toogleplay:function(){
		play();
	},
    stop:function(){
        isPlaying=true;
        play();
    },
    play:function(){
        isPlaying=false;
        play();
    },
    setTempo:function(tmp){
        tempo=tmp;
    }
}
})();
(function(){
	BKGM.Intro=function(Game,link,x,y,width,height,isclose){
		var self=this;
		this.Game=Game;
		if(document.getElementById('intro')){
			this.iframe=document.getElementById('intro');
			// this.iframe.width=width||Game.WIDTH;
			// this.iframe.height=Game.HEIGHT;
			// this.iframe.style.position="absolute";
			// this.iframe.style.display="none";
			// this.iframe.style.top=0+"px";
		} else{
			this.iframe=document.createElement('iframe');
			
			// this.iframe.style.backgroundcolor= "#fff";
			document.body.appendChild(this.iframe);
		}
		this.iframe.src=link||"intro.html";
		this.iframe.width=(width||Game.WIDTH);
		this.iframe.height=(height|| Game.HEIGHT);
		this.iframe.style.position="absolute";
		this.iframe.style.display="none";
		this.iframe.style.top=((y||0)+Game.canvas.offsetTop)+"px";
		this.iframe.style.left=((x||0)+Game.canvas.offsetLeft)+"px";
		this.iframe.style.border="none";
		if(isclose) return;
		if(document.getElementById('close_intro')){
			this.closeButton=document.getElementById('close_intro');
		}else{
			this.closeButton=document.createElement('div');
			this.closeButton.style.width=Game.SCALE*200+"px";
			this.closeButton.style.height=Game.SCALE*50+"px";
			this.closeButton.style.position="fixed";
			// this.iframe.style.display="none";
			y ? this.closeButton.style.top=(y+height-50)+"px" : this.closeButton.style.bottom=0+"px";
			this.closeButton.style.left=(x||(Game.WIDTH/2-Game.SCALE*100))+"px";
			document.body.appendChild(this.closeButton);
		}
	    this.closeButton.style.textAlign="center";
	    this.closeButton.style.lineHeight=50*Game.SCALE+"px";
	    this.closeButton.style.borderRadius=      "7px";
	    this.closeButton.style.backgroundImage="-webkit-linear-gradient(top,#FFF 0%,#0e0e0e 100%)";
	    this.closeButton.style.backgroundImage=       "-moz-linear-gradient(top, #FFFFFF 0%, #0e0e0e 100%)";
	    this.closeButton.style.backgroundImage="-ms-linear-gradient(top,#FFF,#0e0e0e)";
	    this.closeButton.style.backgroundImage="-o-linear-gradient(top,#FFF,#0e0e0e)";
	    this.closeButton.style.backgroundImage="linear-gradient(top,#FFF,#0e0e0e)";
	    this.closeButton.style.border=         "solid #0e0e0e 5px";
	    this.closeButton.style.boxShadow= "0px 0px 0px 5px #0e0e0e, 5px 3px 12px #0e0e0e";
	    this.closeButton.style.fontWeight="bold";
	    this.closeButton.style.fontSize=30*Game.SCALE+"px";
	    this.closeButton.style.textDecoration= "none";	    
	    this.closeButton.style.cursor= "pointer";
	    this.closeButton.innerHTML="B qua";
	    var _down=function(){
	    	self.closeButton.style.boxShadow= "0px 0px 0px 5px #e0e0e0, 5px 3px 12px #e0e0e0";	    	
	    }
	    var _up=function(){
	    	self.closeButton.style.boxShadow= "0px 0px 0px 5px #0e0e0e, 5px 3px 12px #0e0e0e";
	    	if(self._onClick) self._onClick();
	    }
	    if(!BKGM._isCordova){
	    	this.closeButton.style.opacity= .8;	    
		    this.closeButton.onmouseover=function(){
		    	self.closeButton.style.opacity= 1;
		    }
		    this.closeButton.onmouseout=function(){
		    	self.closeButton.style.opacity= 0.8;	    	
		    }
		    this.closeButton.onmousedown=function(){
	    		_down();
		    }
		    this.closeButton.onmouseup=function(){
		    	_up();
		    }
	    } else {
	    	this.closeButton.addEventListener('touchstart',function(event){
	    		if ((!window.navigator.msPointerEnabled && event.touches.length > 1) ||
                event.targetTouches > 1) {
                  return; // Ignore if touching with more than 1 finger
                }
	    		_down();
		    });
		    this.closeButton.addEventListener('touchend',function(event){
		    	if(BKGM.TYPE_TOUCH===BKGM.SINGLE_TOUCH)
                if ((!window.navigator.msPointerEnabled && event.touches.length > 0) ||
	                event.targetTouches > 0) {
	              return; // Ignore if still touching with one or more fingers
	            }
		    	_up();
		    });
	    }	    
	    

	    	

		
	}
	BKGM.Intro.prototype={
		open:function(){
			this.iframe.style.display="inherit";
			if(this.closeButton)this.closeButton.style.display="inherit";
		},
		close:function(){
			this.iframe.style.display="none";
			if(this.closeButton)this.closeButton.style.display="none";
		},
		_onClick:function(){
			this.close();
		}
	}
})();